import React from "react";
import "./SignUpForm.css";

const SignUpForm = () => {
    return (
        <div className="container">
            <form>
                <label>Email</label>
                <input type="email"></input>
                <label>Password</label>
                <input type="password"></input>
                <button type="submit" />
            </form>

        </div>
    )
}

export default SignUpForm;
